import React, { Component } from "react";
import gif from "../../assets/hero.gif";

class Home extends Component {
    render (){
        return (
            <div>
            <section className="container">
                <div className="text-center">
                    <img src={gif}/>
                </div>
            </section>
            <div className="container mt-5">
                <h2>Why code alone?</h2>
                <h3>Find people to collaborate on your projects, browse through the profiles of enthusiastic makers and ping them to collaborate.</h3>
            </div>
            </div>
        )
    }
}

export default Home;
